import React, { useState, useEffect } from 'react';

const ResultTable = ({data}) => {
    return (
        <table>
        <tr>
          <th>Name:</th>
          <td>{data?.name.toUpperCase()}</td>
        </tr>
        { data?.types?.length > 0 ? (
          <tr>
            <th>Type:</th>
            {data.types.map(type => <td>{type.type.name}</td>)}
          </tr>
        ) : null}
        { data?.weight ? (
          <tr>
            <th>Weight:</th>
            <td>{data.weight}</td>
          </tr> 
        ) : null}
        { data?.base_experience ? (
          <tr>
          <th>Base Experience:</th>
          <td>{data.base_experience}</td>
          {/* <td>555 77 855</td> */}
        </tr>
        ) : null} 
        {data?.moves?.length > 0 ? (
          <tr>
            <th>Moves:</th>
            <td>
              <table>
                {data.moves.map((move) => {
                  return <tr>{move.move.name}</tr>
                })}
              </table>
            </td>
          </tr>
        ) : null }

        </table>
    )
} 

export default ResultTable
